import React, {Component} from 'react'
import { NextPageContext } from 'next'
import Layout from "../components/layout";

interface Props {
    userAgent?: string;
}

export default class Index extends Component<Props> {

    render() {
        return (
            <Layout>
                <h1>Accueil</h1>
            </Layout>
        )
    }
}
